prediction.sparql:
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX imdb: <https://www.imdb.com/>
SELECT ?series ?seriesLabel ( COUNT( ?episode ) AS ?numEpisodes ) ?numVotes WHERE {
  ?series imdb:type "tvSeries" .
  ?series imdb:numVotes ?numVotes .
  FILTER ( ?numVotes > 1000000 ) OPTIONAL {
    ?series rdfs:label ?seriesLabel
  }
  ?episode imdb:parentTitle ?series .
}
GROUP BY ?series ?seriesLabel ?numVotes
ORDER BY DESC ( ?numEpisodes )
LIMIT 1

PREFIX imdb_principal: <https://www.imdb.com/principal/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX imdb: <https://www.imdb.com/>
SELECT DISTINCT ?person ( MIN( ?personLabel_ ) AS ?personLabel ) ?title1 ( MIN( ?title1Label_ ) AS ?title1Label ) ?title2 ( MIN( ?title2Label_ ) AS ?title2Label ) WHERE {
  ?title1 imdb_principal:actor ?person .
  ?title2 imdb_principal:director ?person .
  FILTER ( ?title1 != ?title2 ) ?title1 imdb:numVotes ?votes1 .
  ?title2 imdb:numVotes ?votes2 .
  FILTER ( ?votes1 > 100000 && ?votes2 > 100000 ) FILTER NOT EXISTS {
    ?title1 imdb_principal:director ?person
  }
  FILTER NOT EXISTS {
    ?title2 imdb_principal:actor ?person
  }
  OPTIONAL {
    ?person rdfs:label ?personLabel_
  }
  OPTIONAL {
    ?title1 rdfs:label ?title1Label_
  }
  OPTIONAL {
    ?title2 rdfs:label ?title2Label_
  }
}
GROUP BY ?person ?title1 ?title2
LIMIT 100

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX imdb: <https://www.imdb.com/>
SELECT ?movie ?movieLabel ?director ?directorLabel ?rating ?votes ?year WHERE {
  ?movie imdb:type "movie" .
  FILTER NOT EXISTS {
    ?movie imdb:type ?t .
    FILTER ( ?t IN ( "tvEpisode" , "tvMiniSeries" , "tvMovie" , "tvPilot" , "tvSeries" , "tvShort" , "short" , "video" , "videoGame" ) )
  }
  ?movie imdb:director ?director .
  ?movie imdb:averageRating ?rating .
  ?movie imdb:numVotes ?votes .
  ?movie imdb:startYear ?year .
  FILTER ( ?votes >= 100000 ) FILTER NOT EXISTS {
    ?otherMovie imdb:type "movie" .
    FILTER NOT EXISTS {
      ?otherMovie imdb:type ?t2 .
      FILTER ( ?t2 IN ( "tvEpisode" , "tvMiniSeries" , "tvMovie" , "tvPilot" , "tvSeries" , "tvShort" , "short" , "video" , "videoGame" ) )
    }
    ?otherMovie imdb:director ?director .
    ?otherMovie imdb:averageRating ?otherRating .
    ?otherMovie imdb:numVotes ?otherVotes .
    ?otherMovie imdb:startYear ?otherYear .
    FILTER ( ?otherVotes >= 100000 ) FILTER ( ( ?otherRating > ?rating ) || ( ?otherRating = ?rating && ?otherVotes > ?votes ) || ( ?otherRating = ?rating && ?otherVotes = ?votes && ?otherYear < ?year ) || ( ?otherRating = ?rating && ?otherVotes = ?votes && ?otherYear = ?year && STR( ?otherMovie ) < STR( ?movie ) ) )
  }
  OPTIONAL {
    ?movie rdfs:label ?movieLabel
  }
  OPTIONAL {
    ?director rdfs:label ?directorLabel
  }
}
ORDER BY DESC ( ?rating ) DESC ( ?votes ) ASC ( ?year ) ASC ( STR( ?movie ) )
LIMIT 10

PREFIX imdb_principal: <https://www.imdb.com/principal/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX imdb: <https://www.imdb.com/>
SELECT ?actor ?actorLabel ?director ?directorLabel ( COUNT( DISTINCT ?movie ) AS ?collaborations ) WHERE {
  ?movie imdb:type "movie" .
  ?movie imdb:numVotes ?votes .
  FILTER ( ?votes >= 100000 ) {
    SELECT ?movie ( MIN( ?actor0 ) AS ?actor ) WHERE {
      ?movie imdb_principal:actor ?actor0 .
    }
    GROUP BY ?movie
  }
  ?movie imdb_principal:director ?director .
  OPTIONAL {
    ?actor rdfs:label ?actorLabel
  }
  OPTIONAL {
    ?director rdfs:label ?directorLabel
  }
}
GROUP BY ?actor ?actorLabel ?director ?directorLabel
HAVING ( ?collaborations >= 5 )
ORDER BY DESC ( ?collaborations )
LIMIT 10

PREFIX imdb_title: <https://www.imdb.com/title/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX imdb: <https://www.imdb.com/>
SELECT ?episode ?title ?rating WHERE {
  ?episode imdb:parentTitle imdb_title:tt0903747 ; imdb:seasonNumber 5 ; imdb:averageRating ?rating .
  OPTIONAL {
    ?episode rdfs:label ?title
  }
}
ORDER BY DESC ( ?rating )
LIMIT 3

PREFIX imdb_principal: <https://www.imdb.com/principal/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX imdb: <https://www.imdb.com/>
SELECT ?person ?personLabel ( AVG( ?votes ) AS ?avgVotes ) ( COUNT( ?title ) AS ?numTitles ) WHERE {
  VALUES ?roleProp {
    imdb_principal:actor imdb_principal:actress imdb_principal:director imdb_principal:writer imdb_principal:producer imdb_principal:editor imdb_principal:composer imdb_principal:cinematographer imdb_principal:casting_director imdb_principal:production_designer
  }
  ?title ?roleProp ?person .
  ?title imdb:numVotes ?votes .
  FILTER ( ?votes > 0 ) OPTIONAL {
    ?person rdfs:label ?personLabel
  }
}
GROUP BY ?person ?personLabel
HAVING ( COUNT( ?title ) >= 3 )
ORDER BY DESC ( ?avgVotes )
LIMIT 10
